import React from 'react';

const Dashboard = () => {
    return (
        <div style={{ marginTop: '125px', marginLeft: '250px' }}>
            <div style={{ padding: '5px' }}>Logo</div>
            <div style={{ borderWidth: '2px', borderStyle: 'solid', borderColor: 'black', width: '1000px', height: '250px' }}>
                <a>Home</a>
                <a>Employee List</a>
                <a>Hukum Gupta-</a>
                <a>Logout</a>
            </div>
            <div style={{ borderWidth: '2px', borderStyle: 'solid', borderColor: 'black', width: '1000px', height: '250px' }}>
                <div style={{ backgroundColor: 'yellow', padding: '2px', paddingBottom: '5px', paddingLeft: '4px' }}>Dashboard</div>
            </div>
        </div>
    )
}

export default Dashboard;
